INSERT INTO `books` (`BookID`, `BookName`, `AuthorID`, `BookDescription`, `BookPrice`, `BookISBN`, `QuantityRemain`, `Hidden`) VALUES
(1, 'Cirque Du Freak - The Saga of Darren Shan 1 (Paperback)', 1, 'The chilling Saga of Darren Shan, the ordinary schoolboy plunged into the vampire world.\r\nDarren goes to a banned freak show with his best mate Steve. It\'s the wonderfully gothic Cirque Du Freak where weird, frightening half human/half animals appear who interact terrifyingly with the audience. Darren - a spider freak - `falls in love\' with Madam Octa - an enormous tarantala owned by Mr Crepsley. Darren determines to steal the spider so that he can train it to perform amazing deeds. But his daring theft goes horribly wrong and Darren finds himself having to make a bargain with a creature of the night.\r\nSomething out of the ordinary is set against the background of children\'s normal lives to chilling effect. Atmospheric, funny, realistic, moving and... terrifying.', '6.99', 9780006754169, 99, 0),
(2, 'The Vampire\'s Assistant - The Saga of Darren Shan 2 (Paperback)', 1, 'Darren Shan has been made a half-vampire by Mr Crepsley, but the Cirque Du Freak holds more unpleasant surprises for the vampire\'s assistant.\r\nDarren joins the vampire, Mr Crepsley, as his assistant and they return to the Cirque Du Freak. There, Darren makes friends with the snake-boy, Evra Von (who knows what Darren is) and a local boy, Sam, and RV, an eco-warrior and animal lover (who do not). Darren begins to enjoy his life among the Cirque performers as the youngest half-vampire in existence, but he defiantly refuses to drink human blood - the whole idea sickens him - and he tries desperately to cling on to the part of him which is human.\r\nDarren comes face to face with pure evil in the form of Mr Tiny, the leader of the Little People who join the Cirque Du Freak, and who eat anything - including human flesh. When he discovers animal bones, RV frees the wolf-man from his cage - and no-one could possibly guess how truly terrible the whole effect would be.', '6.99', 9780006755135, 51, 0),
(3, 'Tunnels of Blood - The Saga of Darren Shan 3 (Paperback)', 1, 'Darren Shan and Evra Von follow a trail of corpses and confront a foul creature of the night. A new enemy or Mr Crepsley?\r\nWhen Mr Crepsley is called upon by the Vampire Generals, Darren and the snake-boy, Evra Von, leave the Cirque Du Freak and travel with him to the city. Whilst there, Darren meets Debbie and his life as a Vampire\'s Assistant fades into the background - until corpes are found. Corpses drained of blood... Suspicious of Mr Crepsley\'s secretive bahaviour, Darren and Evra shadow him across the city and confront a creature of the night who may be the end of them all...', '6.99', 9780006755142, 100, 0),
(4, 'Vampire Mountain - The Saga of Darren Shan 4 (Paperback)', 1, 'Darren Shan, the vampire\'s assistant, is forced to march to Vampire Mountain where he will be judged by the vampire princes.\r\nDarren Shan and Mr Crepsley make a long and dangerous trek to the vampire\'s stronghold in the mountains. The trek is a test of skill and endurance - one which sees Darren\'s vampire nature develop, and a new understanding of the mysterious blue-robed servants of the sinister Mr Tiny.\r\nGavner Purl makes a welcome return when he joins Darren and Mr Crepsley, but they face more than the cold on their way to the vampire princes - the vampaneze have been there before them...\r\nWill Darren\'s meeting with the Vampire Princes restore his human nature, or turn him further towards the darkness...', '6.99', 9780007114412, 20, 0),
(5, 'Harry Potter and the Philosopher\'s Stone (Paperback)', 2, '\'Potter, did she say?\' \'The Harry Potter?\' Life isn’t much fun at number four Privet Drive, at least not for Harry Potter, living under the stairs in a cupboard full of spiders, but all of that is about to change. On the eve of Harry’s eleventh birthday the letters start arriving; letters written in emerald green ink on yellowing parchment with an unmistakable letter H on purple wax seals. Because Harry Potter is no ordinary boy, he is the boy who lived, the wizard whose name everyone in the magical world knows and he has a place at Hogwarts School of Witchcraft and Wizardry. An incredible adventure is about to begin and life for Harry Potter will never be the same again.', '5.99', 9781408855652, 99, 0),
(6, 'Harry Potter and the Chamber of Secrets (Paperback)', 2, '', '5.99', 9781408855669, 0, 0),
(7, 'Harry Potter and the Prisoner of Azkaban (Paperback)\r\n', 2, '', '5.99', 9781408855676, 0, 0),
(8, 'Harry Potter and the Goblet of Fire (Paperback)', 2, '', '5.99', 9781408855683, 0, 0),
(9, 'Harry Potter and the Order of the Phoenix (Paperback)', 2, '', '5.99', 9781408855690, 0, 0),
(10, 'Harry Potter and the Half-Blood Prince (Paperback)', 2, '', '5.99', 9781408855706, 0, 0),
(11, 'Harry Potter and the Deathly Hallows (Paperback)', 2, '', '6.99', 9781408855713, 0, 0),
(12, 'Trials of Death - The Saga of Darren Shan 5 (Paperback)', 1, 'Compelled by his loyalty to Mr Crepsley, Darren Shan, the vampire’s assistant, agrees to prove his worthiness to the vampire clan by undertaking a series of trials. Each Trial is set by the Vampire Princes to test agility, cunning and intelligence. Failure means death.\r\nWhilst their attention is focused on Darren, the vampire clan fail to notice that the vampaneze have infiltrated their mountain stronghold. Who is the traitor helping the vampaneze, and will Darren survive the trials to oust the vampire’s greatest foes?', '6.99', 9780007114405, 0, 0),
(13, 'The Vampire Prince - The Saga of Darren Shan 6 (Paperback)', 1, 'Darren Shan, the vampire’s assistant, must clear his name and avenge the death of Gavner Purl. Can a half-vampire outwit a Vampire Prince?\r\nBetrayed by Kurda and reeling from the brutal slaying of Gavner, the vampire’s assistant, Darren Shan, finds himself branded a traitor and hunted by the vampire clan.\r\nWill Darren’s failure to complete the Trials mean banishment for Mr Crepsley and execution for himself? Or can Darren return to the home of the damned and exact revenge?\r\nBut Darren comes to realise that there is more than revenge at stake – the vampire clan must combat the rise of the Vampaneze Lord, or see his ascension mark the end of thousands of years of vampire rule…', '6.99', 9780007115167, 0, 0),
(14, 'Tom Clancy\'s Power and Empire - Jack Ryan', 3, 'As America is outmaneuvered by an increasingly bold President Zhou of China, Jack Ryan depends on the operatives of the Campus secret intelligence agency to plug the gaps between diplomacy and negotiation.\r\nBut as an international summit approaches, Ryan must face Zhou alone. What he doesn\'t know is that the secret mastermind plotting conspiracy and destruction has had the leader of the free world in his sights all along . ', '7.99', 9781405934473, 99, 0),
(15, 'Pride and Prejudice (Paperback)', 4, 'When Elizabeth Bennet first meets eligible bachelor Fitzwilliam Darcy, she thinks him arrogant and conceited; he is indifferent to her good looks and lively mind. When she later discovers that Darcy has involved himself in the troubled relationship between his friend Bingley and her beloved sister Jane, she is determined to dislike him more than ever. In the sparkling comedy of manners that follows, Jane Austen shows the folly of judging by first impressions and superbly evokes the friendships, gossip and snobberies of provincial middle-class life.\r\nThe Penguin English Library - 100 editions of the best fiction in English, from the eighteenth century and the very first novels to the beginning of the First World War.', '4.99', 9780141199078, 0, 0);
